INSERT INTO `bedrijfgegevens` (`bedrijfs_id`, `bedrijfsnaam`, `beschrijving`, `adres`, `postcode`, `plaats`, `provincie`, `website`, `telefoon`, `fax`, `specialiteit`, `type`, `bereik`, `transport_manager`, `aantal`, `rechtsvorm`, `vergunning`, `geldig_tot`, `bedrijfs_email`, `premium`) VALUES
(12, 'Koller Transport BV', '<p><span style="font-size:18px">Transportbedrijf in Amersfoort</span></p>\r\n\r\n<p>Koller Transport is gevestigd in Amersfoort, de perfecte uitvalsbasis om uw goederen te bezorgen overal in Nederland en Belgi&euml;. Wij zijn een middelgroot familiebedrijf met 16 vrachtauto&#39;s, 20 personeelsleden en een warehouse van 5500 m2 waarin wij opslagfaciliteiten aanbieden.</p>\r\n\r\n<p><span style="font-size:18px">Eigen wagenpark</span></p>\r\n\r\n<p>Ons wagenpark bestaat uit bakwagens, aanhangers, trekkers en opleggers waaronder ook city-opleggers. Al onze voertuigen zijn voorzien van laad- en loskleppen zodat onze chauffeurs op iedere locatie zelfstandig kunnen laden en lossen. Een aantal vrachtauto&#39;s en opleggers is voorzien van schuifzeilen en schuifdaken, waardoor ook grotere ladingen van opzij en van boven geladen en gelost kunnen worden. Voor vervoer van pallets, complete ladingen tot ondeelbare ladingen kunt u bij ons terecht.</p>\r\n', 'Kryptonweg 3', '3812 RZ', 'Amersfoort', 'Utrecht', '', '0334637444', 'nvt', 'Autotransport, Gevaarlijke stoffen, Gevaarlijke stoffen', 'Wegtransport', 'Nederland', 'onbekend', 100, 'BV', 'eur', '1-1-2099', 'info@koller-transport.nl', 'ja'),
(10, 'CP Benelux BV | ADR transport', '<h1>Transport:</h1>\r\n\r\n<p>meer dan ladingen vervoeren CP Benelux is specialist in het transport, de opslag en distributie van ADR-goederen. Onze opslagloodsen zijn volledig toegerust op veilige en verantwoorde op- en overslag van ADR-goederen. Ook onze medewerkers beschikken over de juiste kennis, ervaring en certificaten om met ADR-goederen te werken. Transport binnen Europa Met CP Benelux is elke Europese bestemming binnen handbereik. Of u nu een spoedlevering heeft, ADR goederen wilt vervoeren of een speciale lading wilt transporteren. Over de weg, over water of door de lucht. Betrouwbare partner in transport Kwaliteit voert bij ons de boventoon. De regie over het transport houden wij daarom geheel in eigen hand. Wij beschikken over eigen trucks, die volledig zijn toegerust op het vervoer van ADR goederen en het lossen en laden aan boord van schepen. Daarnaast hebben we een zorgvuldig netwerk opgebouwd met vervoerders in heel Europa. Dit in combinatie met onze jarenlange marktkennis en expertise binnen de CP Group maakt van ons een betrouwbare partner voor multimodaal transport in heel Europa.</p>\r\n', 'G.Burgerlaan 33', '3131 KZ', 'Vlaardingen', 'Zuid-Holland', '', '0102994999', 'nvt', 'Autotransport', 'Wegtransport', 'Europa', 'onbekend', 50, 'BV.', 'eur', '1-1-2099', 'order@cpgroup.nl', 'nee'),
(11, 'Veldwerk Transport B.V.', 'Het begin\r\n\r\nHet was ergens in het voorjaar van 1988 toen Koos van Velden, indertijd taxichauffeur, een passagier veilig en snel naar een opgegeven adres had gebracht en een toekomstplan kreeg: “Ik ken het Westland op m’n duimpje, vind autorijden leuk (het was toen ook nog niet zo druk in het verkeer) en service verlenen zit me in het bloed, weet je wat? Ik ga een koeriersbedrijfje beginnen!”\r\n\r\nDus zo gezegd, zo gedaan. Na grondig overleg met zijn vrouw Ella en de zaakjes berekend te hebben, bleek dat het haalbaar zou kunnen zijn. In mei van dat jaar kwam de eerste auto, een Volkswagen Golf.\r\n\r\nHet was een tweedehandsje en toen ze in juli 1992 met pensioen ging had ze er 292.000 kilometer op zitten. Natuurlijk kwamen er meer auto’s bij, ook combo’s en  bussen en er werd zelfs naar vrachtauto’s gekeken, want de klanten kwamen en ieder met eigen wensen. Veldwerk Koerier begon echt te groeien, dus verstandig investeren in mens en materieel was het credo.', 'De Hondert Margen 16', '2678 AC', 'De Lier', 'Zuid-holland', '', '0174 - 44 10 77', 'nvt', 'Gevaarlijke stoffen', 'Wegtransport', 'Europa', 'onbekend', 30, 'BV.', 'eur', '1-1-2099', 'planning@veldwerk.info', 'ja'),
